def generate_collision_rect_string(dictionary_entry):
    length = len(dictionary_entry)

    generated_string = ""

    for number in range(0, length):
        sub_entries_length = len(dictionary_entry[number])

#        if number != length - 1:
#            generated_string += str(number) + " : " + str(dictionary_entry[number]) + ",\n\t\t"
#        if number == length - 1:
#            generated_string += str(number) + " : " + str(dictionary_entry[number])

        generated_string += str(number) + " : "
        for secondary_number in range(0, sub_entries_length):

            if secondary_number != sub_entries_length - 1:
                generated_string += dictionary_entry[number][secondary_number] + ", "
            else:
                if number != length - 1:
                    generated_string += dictionary_entry[number][secondary_number] + "\n\t\t"
                else:
                    generated_string += dictionary_entry[number][secondary_number]
    
    return generated_string


